class CrtFonts {
    private static _Fonts: string[] = [];

    public static Add(codePage: string, width: number, height: number, data: string): void {
        this._Fonts[codePage + 'x' + width + 'x' + height] = 'data:image/png;base64,' + data;
    }

    public static Get(codePage: string, width: number, height: number): string {
        return this._Fonts[codePage + 'x' + width + 'x' + height];
    }
}

